const Collections = ({ notes }) => {
  const handleContent = () => notes.map((note) => <li>{note.content}</li>);

  return (
    <div>
      <h1>Notes</h1>
      <ul>{handleContent()}</ul>
    </div>
  );
};

export default Collections;
